import React from "react";
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardHeader,
  CardMedia,
  Grid,
  CardActions,
  Button,
} from "@mui/material";

export default function TourContent({ id, image, info, name, price }) {
  return (
    <Card sx={{ borderRadius: "10", boxShadow: "5px 5px 5px 5px #888888" }}>
      <CardMedia component="img" height="194" image={image} />
      <CardContent>
        <Grid container>
          <Grid item xs={8} alignItems="center">
            <Typography
              variant="h6"
              sx={{ fontWeight: "bold", fontColor: "black" }}
            >
              {name}
            </Typography>
          </Grid>
          <Grid item xs={4}>
            <Box sx={{ boxShadow: "blue" }}>
              <Typography variant="body2" color="text.primary">
                {price}
              </Typography>
            </Box>
          </Grid>
        </Grid>
        <Typography variant="body2" color="text.secondary">
          {info}
        </Typography>
        <Button
          sx={{
            color: "pink",
            width: "100%",
            textTransform: "none",
            fontWeight: "bold",
            fontSize: "1.2rem",
            backgroundColor: "#900C3F",
            "&:hover": {
              backgroundColor: "#f28ab2",
            },
          }}
        >
          Not Interested
        </Button>
      </CardContent>
    </Card>
  );
}
